using System.Linq;

namespace Day08
{
    internal class Program
    {
        static void Main(string[] args)
        {
            var input = _input;

            var instructions = input.Split(Environment.NewLine).First();
            var lines = input.Split(Environment.NewLine, StringSplitOptions.RemoveEmptyEntries).Skip(1);

            var nodes = lines.Select(x => new Directions(x.Substring(0, 3), x.Substring(7, 3), x.Substring(12, 3))).ToDictionary(x => x.Node);

            Puzzle1(instructions, nodes, "AAA", "ZZZ");
            Puzzle2(instructions, nodes);
        }

        private static void Puzzle2(string instructions, Dictionary<string, Directions> nodes)
        {
            var currentNodes = nodes.Keys.Where(x => x.EndsWith('A')).ToArray();
            var steps = 0l;

            Console.WriteLine($"There are {currentNodes.Count()} starting nodes");

            var maxSteps = currentNodes.Select(node => Puzzle1(instructions, nodes, node, "Z")).ToArray();

            while (maxSteps.Distinct().Count() > 1)
            {
                maxSteps = currentNodes.Select(node => Puzzle1(instructions, nodes, node, "Z", maxSteps.Max())).ToArray();
            }

            Console.WriteLine($"Ghosts got there in {maxSteps.First()}");

        }
        private static long Puzzle1(string instructions, Dictionary<string, Directions> nodes, string startNode, string endNode, long minSteps = 0)
        {
            var currentNode = startNode;
            var steps = 0l;

            while (!currentNode.EndsWith(endNode) || steps < minSteps)
            {
                foreach (var c in instructions)
                {
                    switch (c)
                    {
                        case 'L':
                            currentNode = nodes[currentNode].L;
                            break;
                        case 'R':
                            currentNode = nodes[currentNode].R;
                            break;
                        default:
                            break;
                    }

                    steps++;
                    if (currentNode.EndsWith(endNode) || steps < minSteps)
                    {
                        break;
                    }
                }
            }

            Console.WriteLine($"Reached goal ({currentNode}) for {startNode} in {steps} steps.");
            return steps;
        }

        private record EndState(string Node, long Steps);

        private record Directions(string Node, string L, string R);

